import React from "react";
import loadingGif from "../assets/loading-gif (1).gif";
function home() {
  const getGame = (req, res) => {};
  return (
    <div className="row row3">
      <div className="col-md-12">
        <h1 id="enterName">Enter your Name : </h1>
        <input type="text" placeholder="Player1" id="name" autoComplete="off" />
        <div className="col-md-12">
          <button onClick={getGame} id="find">
            Search for a player
          </button>
          <br />
          <a href="/test">test</a>
          <img src={loadingGif} id="loading" alt="loading" />
        </div>
      </div>
    </div>
  );
}

export default home;
